const Header = (props) => {
    return <h1>{props.course}</h1>
}

const Content = (props) => {
    return (
        <>
            {props.content.forEach((value, key, map) => {
                return <Part part={key} exercises={value} />
            })}
        </>
    )
}

const Total = (props) => {
    return <p>Number of exercises {props.sum}</p>
}

const Part = (props) => {
    return <p>{props.part} {props.value}</p>
}

export { Header, Content, Total }
